[Resume.io]


Hi Dhanashree,

If you’ve been offered a job, it’s because they want you. Please don’t accept their first offer. Take a breath.

Negotiate and you could increase your starting salary by 7%. The first step is to find out how much they’re expecting to pay you.


You deserve more


‘Fair pay’ doesn’t really exist. Your starting point is what others get paid for the same job. Find out with the Salary Analyzer. It’s free!


Get paid more
<https://resume.io/app/offer-analyzer?utm_content=get_paid_more>


Always ask...

Almost 90% of people get something when they ask. It could be money, training or flexible work. If they want you, they’ll say yes. But you have to ask!


Anchor high

Always request at least 10% above the going rate. This is called ‘anchoring’. You probably won’t get that, but you might get 5% and added benefits.


So what are you worth?

Find out here
